import React from 'react';
import { ArrowRight } from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const OrdiniWidget = ({ ordiniAttivi }) => {
  const navigate = useNavigate();

  // Funzione per formattare l'orario
  const formatTime = (dateString) => {
    if (!dateString) return 'N/D';
    const date = new Date(dateString);
    return isNaN(date.getTime()) ? 'N/D' : date.toLocaleTimeString('it-IT', { hour: '2-digit', minute: '2-digit' });
  };

  // Funzione per ottenere il colore dello stato
  const getStatoColor = (stato) => {
    switch (stato?.toLowerCase()) {
      case 'nuovo': return 'bg-blue-100 text-blue-800';
      case 'in preparazione': return 'bg-amber-100 text-amber-800';
      case 'in consegna': return 'bg-purple-100 text-purple-800';
      case 'consegnato': return 'bg-green-100 text-green-800';
      case 'annullato': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div>
      <div className="flex justify-between items-center mb-2">
        <h3 className="text-gray-700 font-medium">Ordini Attivi</h3>
        <button 
          className="text-red-600 hover:text-red-800 flex items-center text-sm"
          onClick={() => navigate('/ordini')}
        >
          Vedi Tutti
          <ArrowRight size={14} className="ml-1" />
        </button>
      </div>

      {!ordiniAttivi || ordiniAttivi.length === 0 ? (
        <div className="bg-white rounded-lg p-4 text-center text-gray-500">
          Nessun ordine attivo al momento
        </div>
      ) : (
        <div className="space-y-2">
          {ordiniAttivi.map((ordine, index) => {
            // Estrai informazioni dell'ordine con valori di fallback
            const numeroOrdine = ordine.numero || `${new Date().getFullYear()}${String(index + 1).padStart(3, '0')}`;
            const nomeCliente = ordine.cliente?.nome || 'Cliente';
            const indirizzoConsegna = ordine.indirizzo || 'N/D';
            const tipoOrdine = ordine.tipo || 'N/D';
            const stato = ordine.stato || 'Nuovo';
            
            return (
              <div key={ordine._id || index} className="bg-white rounded-lg p-3 shadow-sm hover:shadow-md transition-all">
                <div className="flex justify-between items-start">
                  <div>
                    <div className="flex items-center gap-2">
                      <span className="font-medium text-gray-800">{numeroOrdine}</span>
                      <span className="text-xs text-gray-500">{formatTime(ordine.dataOrdine)}</span>
                    </div>
                    
                    <div className="mt-1 text-sm">
                      <div className="font-medium">{nomeCliente}</div>
                      {tipoOrdine.toLowerCase() === 'consegna' && (
                        <div className="text-gray-600 text-xs">{indirizzoConsegna}</div>
                      )}
                    </div>
                  </div>
                  
                  <div className="flex flex-col items-end">
                    <div className={`px-2 py-0.5 rounded-full text-xs font-medium ${getStatoColor(stato)}`}>
                      {stato}
                    </div>
                    <div className="mt-1 text-xs text-gray-500">
                      {tipoOrdine}
                    </div>
                  </div>
                </div>
                
                {/* Opzionale: Visualizza i prodotti ordinati */}
                {ordine.prodotti && ordine.prodotti.length > 0 && (
                  <div className="mt-2 pt-2 border-t border-gray-100">
                    <div className="text-xs text-gray-600">
                      {ordine.prodotti.slice(0, 2).map((p, i) => (
                        <div key={i}>
                          {p.quantita || 1}x {p.nome || 'Prodotto'}
                        </div>
                      ))}
                      {ordine.prodotti.length > 2 && (
                        <div className="text-gray-500">+{ordine.prodotti.length - 2} altri</div>
                      )}
                    </div>
                  </div>
                )}
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default OrdiniWidget;
